import{_ as e,o as a,c as t,O as s}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 46.2-692.1 Sample license plates; fee; use.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-692.1.md","filePath":"vacode/46.2-692.1.md"}'),l={name:"vacode/46.2-692.1.md"},r=s('<h1 id="§-46-2-692-1-sample-license-plates-fee-use" tabindex="-1">§ 46.2-692.1 Sample license plates; fee; use. <a class="header-anchor" href="#§-46-2-692-1-sample-license-plates-fee-use" aria-label="Permalink to &quot;§ 46.2-692.1 Sample license plates; fee; use.&quot;">​</a></h1><p>Upon application therefor, the Commissioner may issue samples of authorized license plates currently issued by the Department. Sample license plates may display, as requested by the applicant and approved by the Commissioner, a combination of up to seven numbers or letters, when feasible. Notwithstanding the provisions of this section, every such license plate shall display the word &quot;SAMPLE&quot; on its face, in a manner prescribed by the Commissioner.</p><p>The fee for sample license plates not displaying numbers or letters requested by the applicant shall be ten dollars for each license plate. The fee for sample license plates displaying numbers or letters requested by the applicant shall be twenty dollars for each license plate. Sample license plates shall not be valid for registration purposes and shall not be mounted or displayed on any motor vehicle.</p><p>1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1026" target="_blank" rel="noreferrer">1026</a>; 1997, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0774" target="_blank" rel="noreferrer">774</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0816" target="_blank" rel="noreferrer">816</a>.</p>',4),i=[r];function n(o,p,c,h,d,f){return a(),t("div",null,i)}const u=e(l,[["render",n]]);export{_ as __pageData,u as default};
